import './App.css';

function App() {
  return (
    <div className="App">
      <div style={{ backgroundColor: 'black', padding: '10px' }}>
      <h1 style={{color:'#b8860b',margin: '0'}}>Canon</h1>
      </div>
      <header className="App-header">
      </header>
      
    </div>
  );
}

export default App;
